import { Table } from "antd";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import { Tabs, Layout } from "antd";
import { Typography } from "antd";
import "./style.css";
const { Title } = Typography;
const { TabPane } = Tabs;
const { Content } = Layout;
function callback(key) {
  console.log(key);
}

const columns = [
  {
    title: "Mã Nhân Viên",
    dataIndex: "MaNV",
    key: "MaNV",
    render: (text) => {
      return (
          <Layout>
            <Content>
            <Link to="/ChiTietNhanVien">{text}</Link>
            </Content>
          </Layout>
      );
    },
  },
  {
    title: "Tên nhân viên",
    key: "TenNV",
    dataIndex: "TenNV",
  },
  {
    title: "Ngày biến động",
    dataIndex: "NgayBD",
    key: "NgayBD",
  },
  {
    title: "Lương hiện tại",
    key: "LuongHT",
    dataIndex: "LuongHT",
  },
];

const data = [
  {
    MaNV: "1",
    TenNV: "Lương Long Hà",
    NgayBD: "14/07/2021",
    LuongHT: "20000000",
    GhiChu: "bdhfksdfhksdgioglagjeilgjaeoighaerlghae;",
  },
  {
    MaNV: "2",
    TenNV: "Nguyễn Trọng Khang",
    NgayBD: "09/01/2021",
    LuongHT: "30000000",
    GhiChu: "It's High Noonnnnn;",
  },
  {
    MaNV: "1",
    TenNV: "Lương Long Hà",
    NgayBD: "14/07/2021",
    LuongHT: "20000000",
    GhiChu: "bdhfksdfhksdgioglagjeilgjaeoighaerlghae;",
  },
  {
    MaNV: "1",
    TenNV: "Lương Long Hà",
    NgayBD: "14/07/2021",
    LuongHT: "20000000",
    GhiChu: "bdhfksdfhksdgioglagjeilgjaeoighaerlghae;",
  },
];

function LuongNVGH() {
  return (
    <div>
      <Layout>
        <Content>
          <Title level={2} classname="titlename">
            Thống kê lương Nhân Viên Giao Hàng
          </Title>

          <Tabs onChange={callback} type="card">
            <TabPane tab="Tất cả" key="1">
              <Table columns={columns} dataSource={data} />
            </TabPane>
            <TabPane tab="Chờ xác nhận" key="2">
              <Table columns={columns} dataSource={data} />
            </TabPane>
            <TabPane tab="Đang xử lý" key="3">
              <Table columns={columns} dataSource={data} />
            </TabPane>
            <TabPane tab="Đang vận chuyển" key="4">
              <Table columns={columns} dataSource={data} />
            </TabPane>
            <TabPane tab="Đã giao hàng" key="5">
              <Table columns={columns} dataSource={data} />
            </TabPane>
            <TabPane tab="Đã hủy" key="6">
              <Table columns={columns} dataSource={data} />
            </TabPane>
          </Tabs>
          <br />
        </Content>
      </Layout>
    </div>
  );
}

export default LuongNVGH;
